import authHeader from "../user/auth-header";
import axios from "axios";

import { ip, tomcatPort } from "../../misc/constants";
import {doPostAsync} from "../api";

const URL = `http://${ip}:${tomcatPort}/api/charger`

const fetchChargers = async () => {
    return await doPostAsync(`${URL}/getAllChargers`, null, authHeader());
};

export { fetchChargers }
